import React from "react";

function AddDataForm({ onChange, newData, idRef, nameRef, emailRef, phoneRef }) {
  return (
    <form>
      <label>
        ID:
        <input
          type="text"
          name="id"
          value={newData.id}
          onChange={onChange}
          ref={idRef} // ref 추가
        />
      </label><br />
      <label>
        이름:
        <input
          type="text"
          name="name"
          value={newData.name}
          onChange={onChange}
          ref={nameRef} // ref 추가
        />
      </label><br />
      <label>
        Email:
        <input
          type="email"
          name="email"
          value={newData.email}
          onChange={onChange}
          ref={emailRef} // ref 추가
        />
      </label><br />
      <label>
        Phone:
        <input
          type="text"
          name="phone"
          value={newData.phone}
          onChange={onChange}
          ref={phoneRef} // ref 추가
        />
      </label><br />
    </form>
  );
}

export default AddDataForm;
